query:
query CricketManhattanQuery($matchKey: String!) {
  cricket_match_manhattan(match_key: $matchKey) {
    first_bat_team {
      key
      code
      name
      __typename
    }
    first_bowl_team {
      key
      code
      name
      __typename
    }
    x
    y
    y2_wickets
    x_axis_label
    y_axis_label
    data_label
    chart_type
    y_colors
    __typename
  }
}
